import React from 'react';
import {Button ,TextField} from "@material-ui/core";
const Firstpage = () => {
  return (
    <div>
    <div><TextField id="outlined-basic" label="FirstName" variant="outlined" /></div>
    <div><TextField id="outlined-basic" label="LastName" variant="outlined" /></div>
    <div><Button style={{maxWidth: '500px', maxHeight: '30px',}} variant="contained">Next</Button></div>
      
    </div>
  );
}

export default Firstpage;
